import React from "react";
import "../App.css";

function Login() {
  return (
    <div className="align-items-center d-flex align-items-center justify-content-center text-center">
      <div className="border rounded align-items-center container container-fluid">
        <div>
          <h1>Enter your login credentials</h1>
        </div>
        <div>
          <form action="">
            <div className="my-3">
              <input type="text" id="email" placeholder="Email" minLength={5} />
            </div>
            <div className="my-3">
              <input type="text" name="password" placeholder="Password" />
            </div>
          </form>
        </div>
      </div>
    </div>
  );
}

export default Login;
